import React from 'react';
import styled from 'styled-components';
import NavBar from '../ui/NavBar';
import ProfileImage from '../ui/ProfileImage.jpeg'; 

const Container = styled.div`
    margin: 20px;
    font-family: Arial, sans-serif;
    margin-top: 60px; /* NavBar와의 간격 추가 */
`;

const Header = styled.div`
    display: flex;
    align-items: center;
    padding: 20px;
    border-radius: 10px;
    margin-bottom: 20px;
`;

const ProfileImageContainer = styled.div`
    border-radius: 50%;
    overflow: hidden;
    width: 60px;
    height: 60px;
    margin-right: 20px;
`;

const ProImage = styled.img`
    width: 100%;
    height: 100%;
    object-fit: cover;
`;

const UserInfo = styled.div`
    display: flex;
    flex-direction: column;
`;

const UserName = styled.h1`
    margin: 0;
    font-size: 1.5em;
`;

const UserEmail = styled.p`
    margin: 5px 0 0 0;
`;

const ButtonGroup = styled.div`
    margin-left: auto;
    display: flex;
    gap: 10px;
`;

const Button = styled.button`
    background-color: #348a8c;
    color: white;
    border: none;
    padding: 10px 20px;
    border-radius: 5px;
    cursor: pointer;

    &:hover {
        background-color: #2d7374;
    }
`;

const Section = styled.div`
    margin-bottom: 20px;
    padding: 20px;
    border: 1px solid #348a8c;
    border-radius: 10px;
`;

const Title = styled.h2`
    font-size: 1.2em;
    margin-bottom: 10px;
    position: relative;
    padding-bottom: 10px;

    &::after {
        content: '';
        position: absolute;
        left: 0;
        bottom: 0;
        width: 100%;
        height: 1px;
        background: #348a8c;
    }
`;

const InfoList = styled.ul`
    list-style-type: none;
    padding: 0;
`;

const InfoItem = styled.li`
    margin-bottom: 5px;
`;

const Table = styled.table`
    width: 100%;
    border-collapse: collapse;
    margin-top: 20px;
`;

const Th = styled.th`
    text-align: left;
    border-bottom: 2px solid #348a8c;
    padding: 10px;
`;

const Td = styled.td`
    text-align: left;
    border-bottom: 1px solid #348a8c;
    padding: 10px;
`;

const ActionButton = styled.button`
    background-color: #348a8c;
    color: white;
    border: none;
    padding: 5px 10px;
    border-radius: 5px;
    cursor: pointer;

    &:hover {
        background-color: #2d7374;
    }
`;

const MyPage = () => {
    return (
        <>
            <NavBar />
            <Container>
                <Header>
                    <ProfileImageContainer>
                        <ProImage src={ProfileImage} alt="Profile" />
                </ProfileImageContainer>
                    <UserInfo>
                        <UserName>strgurl님의 마이페이지</UserName>
                        <UserEmail>strgurl</UserEmail>
                    </UserInfo>
                    <ButtonGroup>
                        <Button>기본 정보 수정</Button>
                        <Button>추가 정보 제출</Button>
                    </ButtonGroup>
                </Header>

                <Section>
                    <Title>기본 정보</Title>
                    <InfoList>
                        <InfoItem>닉네임          strgurl</InfoItem>
                        <InfoItem>성명          김키티</InfoItem>
                        <InfoItem>생년월일          2001.04.07</InfoItem>
                        <InfoItem>이메일          strgurl47@ewhain.net</InfoItem>
                        <InfoItem>전화번호          010-1234-5678</InfoItem>
                    </InfoList>
                </Section>

                <Section>
                    <Title>장학금 지원서 작성 현황</Title>
                    <Table>
                        <thead>
                            <tr>
                                <Th>재단명</Th>
                                <Th>장학금명</Th>
                                <Th>수정</Th>
                            </tr>
                        </thead>
                        <tbody>
                            <tr>
                                <Td>재단명1</Td>
                                <Td>장학금명1</Td>
                                <Td><ActionButton>수정</ActionButton></Td>
                            </tr>
                            <tr>
                                <Td>재단명2</Td>
                                <Td>장학금명2</Td>
                                <Td><ActionButton>수정</ActionButton></Td>
                            </tr>
                            <tr>
                                <Td>재단명3</Td>
                                <Td>장학금명3</Td>
                                <Td><ActionButton>수정</ActionButton></Td>
                            </tr>
                        </tbody>
                    </Table>
                </Section>
            </Container>
        </>
    );
};

export default MyPage;
